import React, { useEffect } from "react"
import {useSelector} from "react-redux"
import {useOrgdata,useUpdata,useNewdata} from "../store/action/index"
import {useLocation} from "react-router-dom"
import qs from "qs"
function TopList(){
    let loca = useLocation().pathname
    let state = useSelector((state)=>{
        return state.ToplistReducer
    })
    let getUpData = useUpdata();
    let getNewData = useNewdata();
    let getOrgdata = useOrgdata();
    useEffect(()=>{
        getUpData("/top/list?idx=3")
        getNewData("/top/list?idx=0")
        getOrgdata("/top/list?idx=2")
    },[loca])
    console.log(state)
    return(
        <div className="notic-muc">
             <div className="notice-top-wrap">
             <div className="notice-top">
                <div className="notice-log Top-logo">
                    <img src={(state.Orgdata===undefined||state.Orgdata.length===0)?"":state.Orgdata.playlist.name} alt=""/>
                    <a href="" className="notice-cover"></a>
                </div>
                <div className="notice-tit">
                        <a href=""><h3>{(state.Orgdata===undefined||state.Orgdata.length===0)?"":"shi"}</h3></a>
                        <div className="notice-tit-cover">
                            <a href="" className="notice-play"></a>
                            <a href="" className="notice-add"></a>
                        </div>
                </div>
                </div>
             </div>
        </div>
    )
}

export default TopList;
